function get_first_url(data){
    var parser = new DOMParser();
    var doc = parser.parseFromString(data, "text/html");


    // Get all anchor elements from the parsed HTML
    var anchors = doc.querySelectorAll('a');

    // Extract and print href attributes that meet the criteria
    for (var i = 0; i < anchors.length; i++) {
        var href = anchors[i].getAttribute('href');
        if (href && href.startsWith("https://") && 
            !href.startsWith("https://accounts.") && 
            !href.startsWith("https://scholar.")) {
            //console.log(href);
            return href;
            // break;
        }
    }
    return "";
}

// Function to fetch a URL and process it
function fetchAndProcess(url) {
    // Make an HTTP GET request to the URL

    
    fetch(url)
        .then(response => response.text())
        .then(data => {
            // Process the data (e.g., extract links)
            // Replace this with your actual processing logic
            // console.log("Processing data for URL:", url);
            let perc = (index +1) / total_urls; 
            perc = Math.round(perc * 100);
            console.log(index + " of " + total_urls + ": " + perc + "%");
            download("scholar_" + index + ".html", data);
            index ++; 
            //var href = get_first_url(data);
            // console.log(href)
            // Generate a random delay between 10 and 15 seconds (in milliseconds)
            var delay = Math.floor(Math.random() * 6000) + 15000; // 10,000 to 15,000 milliseconds

            // Schedule the next URL fetch after the random delay
            setTimeout(function() {
                // Continue with the next URL if available
                var nextUrl = urls.shift();
                if (nextUrl) {
                    fetchAndProcess(nextUrl);
                } else {
                    console.log("All URLs processed.");
                }
            }, delay);
        })
        .catch(error => {
            console.error("Error fetching data for URL:", url, error);

            // Retry fetching the same URL after a delay
            setTimeout(function() {
                fetchAndProcess(url);
            }, 5000); // Retry after 5 seconds in case of an error
        });
}

